import AvailableMeals from "./AvailableMeals"
import classes from './MealsItems.module.css'

const MealsItems = (props) => {
    return(
        <li>
            <div>
                <h3>{props.name}</h3>
            </div>
            <div className={classes.description}>
                {props.description}
            </div>
            <div className={classes.price}>
                {props.price}
            </div>
        </li>
    )
}

export default MealsItems
